(66, 10, 0, '', 'CDD Spring Training', '2013-05-11', NULL, 'Sheridan High School CO', '39.644875, -105.030212', '<p>Spring Training is coming! Don''t miss your chance to come out and get ready for the upcoming season. Learn from the pros in this valuable and fun clinic! If you''ve ever thought you might like to give the whole frisbee dog thing a try, this is the time and place to do it. Whether you have no experience, a little, or a lot -- there''s plenty for everyone!</p>\n<p>&nbsp;<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />As in past years, we will work on everything from the basics to the more advanced topics. We will again also offer 15 minute ''private lessons'' giving you a chance to work one-on-one with our most experienced teams on any specific issues you desire.&nbsp;<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />The cost is $25 per team, or $35 for a family (multiple handlers or dogs). You will receive a competition-approved Wham-o "Fastback" frisbee with your registration.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />The private lessons are $10 for each 15 minute session.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />Call Rick Brydum (720-495-4941) prior to May 11th for more information.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />Hope to see many of you on Saturday, May 12th!! Be sure to bring your dog, your leash, water, and umbrella!<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />Spring Training Schedule:</p>\n<ul>\n<li>12:30 pm - registration opens</li>\n</ul>\n<ul>\n<li>1:00 pm-Spring training begins.</li>\n</ul>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 10:49:29', 1, '2013-01-12 11:56:29', 1, 0),
(67, 2, 0, '', 'Thornton Fest (Skyhoundz Regional Qualifier)', '2013-05-18', NULL, 'Thornton Recreation Center, CO', '39.8971273, -104.94235040000001', '<p>The Colorado Disc Dogs are excited to host, as their season opener, the Skyhoundz West Open Qualifier, on Saturday, May 19, in Thornton Colorado.</p>\n<p>The Skyhoundz competition will once again be the main event at this year''s Thorntonfest, an annual festival that typically draws a large family audience of more than 38,000 each year. This year''s festival will feature arts and crafts, business and non-profit exhibitors, a custom car show, carnival rides, a great selection of food and entertainment and much more! Thorntonfest and the competition are both held at the Multipurpose Fields at 108th Avenue &amp; Colorado Blvd. For a complete list of activities visit the Thorntonfest website.</p>\n<p>Entry fee is $10 per dog, per division entered.</p>\n<p>Online Registration is now closed. On site registration will open at 8am Saturday morning.</p>\n<p>Check out the competition! See who''s registered so far: click here!&nbsp;</p>\n<p>The following divisions are being offered:</p>\n<p>Open (Freestyle/Combined)</p>\n<p>- Skyhoundz Expert / CDD Open</p>\n<p>- Skyhoundz Micro Dog</p>\n<p>- Skyhoundz Youth Division</p>\n<p>- Skyhoundz Master (Senior Dog)</p>\n<p>For teams that wish to enter a dog in multiple classes (like Open and Micro), they must pay both entry fees.&nbsp;</p>\n<p>Pairs Freestyle</p>\n<p>- Skyhoundz Expert</p>\n<p>Sport (Distance Accuracy)</p>\n<p>- Skyhoundz Expert / CDD Advanced/A</p>\n<p>- CDD Novice D/A</p>\n<p>The competition will begin at 9:00am, with registration starting at 8:00am. The preliminary rounds of all the divisions and classes will be run simultaneously on two fields, with the secondary rounds slated to begin before noon.&nbsp;</p>\n<p>Schedule:</p>\n<p>We will be running 2 fields simultaneously. The order for the day is:</p>\n<p>Field 1 (Main field):</p>\n<p>9:00am - Open/Micro/Masters Freestyle Round 1</p>\n<p>12:00pm - Pairs Freestyle</p>\n<p>1:00pm - Intemediate top 10 D/A</p>\n<p>1:30pm - Novice top 10 D/A</p>\n<p>2:00 pm - Open/Micro/Masters top 6 D/A</p>\n<p>3:00 pm - Advanced top 6 D/A</p>\n<p>3:30 pm - Open/Micro/Masters top 6 FS</p>\n<p>4:00 pm - Awards Ceremony</p>\n<p>&nbsp;</p>\n<p>Field 2:</p>\n<p>9:30am-Intermediate (D/A)</p>\n<p>10am- Novice (D/A)</p>\n<p>11am - Advanced (Skyhoundz Expert-Sport) D/A</p>\n<p>&nbsp;</p>\n<p>Please note that these times are APPROXIMATE. If you are competing, there is a</p>\n<p>chance your division could be run a bit early if we are moving fast, or it could</p>\n<p>be delayed if we have big divisions. Please be flexible.&nbsp;</p>\n<p>Hotel Accommodations:&nbsp;</p>\n<p>Super 8 Motel</p>\n<p>120th and I-25</p>\n<p>12055 Melody Dr, Denver, CO 80234</p>\n<p>(303) 451-7200</p>\n<p>&nbsp;</p>\n<p>Friday, 05/18/2012 - Field Setup</p>\n<p>Field setup willegin at about 4:00pm on Friday evening. If you are available to lend a hand setting up and marking the fields, it should be fun. This is also a perfect opportunity to get your tents set up in a prime location. Tents can be setup starting at 6pm. There IS overnight security provided by the city for Friday night only.&nbsp;</p>\n<p>&nbsp;</p>\n<p>The Colorado Disc Dogs would like to thank our supporters! The City of Thornton for the generator, ice, field paint, field use, tables, chairs and Fastback event Discs supplied to all competitors. Skyhoundz for the Hyperflite Discs and registration materials.</p>\n<p>&nbsp;</p>\n<p>Colorado Disc Dogs</p>\n<p>Darrel and Marie Earle - Event Coordinator</p>\n<p>Please call 303-929-4033 for more information</p>', 'Super 8 Motel', '', '12055 Melody Dr', 'Denver', 'CO', 80234, '(303) 451-7200', '39.914994, -104.99471189999997', NULL, '2013-01-12 11:00:02', 1, '2013-01-13 09:21:16', 1, 0),
(68, 8, 0, '', 'AWI Qualifier', '2013-05-19', NULL, 'Thornton Recreation Center, CO', '39.8971273, -104.94235040000001', '<p>Latest Updates on the AWI Qualifier can be found by checking out the Hero Disc USA Facebook Feed HERE.</p>\n<p>&nbsp;</p>\n<p>On Sunday May 20th at the Thornton Rec Fields the Colorado Ashley Whippet Invitational Qualifier will take place.</p>\n<p>&nbsp;</p>\n<p>Teams will compete in both Freestyle and Toss &amp; Catch. There is a $20 per team entry.</p>\n<p>&nbsp;</p>\n<p>Complete rules and details can be found at: http://www.ashleywhippet.com/&nbsp;</p>\n<p>&nbsp;</p>\n<p>Pre-registration is strongly recommended. On-site registration will be available, and will close at 8:30 am SHARP. No exceptions. If you have pre-registered you must check in, sign your scoresheet, pay and pick up your AWI loot by 8:30.</p>\n<p>&nbsp;</p>\n<p>At 8:45 there will be a player''s meeting and the first competitor will take the field at 9:00 am sharp.&nbsp;</p>\n<p>&nbsp;</p>\n<p>There will also be the TP Toss &amp; Catch division. One division, $10 per entry with a max of three entries per person. If you are competing in the AWI and the TP Toss &amp; Catch Division with the same dog, your FIRST round of T&amp;C will count for both your AWI and your TP rounds.</p>\n<p>The winner of the TP T&amp;C division will win 20% of the entry fees, and an additional 10% will be donated in the winner''s name to the Western Border Collie Rescue!!</p>\n<p>There will be a cut for the second round of T&amp;C in this division. Tentatively, the cut is set at 15, but we may be able to increase that as we see how well the day is progressing.</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:01:53', 1, '2013-01-12 11:58:41', 1, 0),
(69, 3, 0, '', 'Ft. Collins, CO - Payton Classic', '2013-06-01', NULL, 'City Park Ft Collins CO', '40.5858082, -105.10543080000002', '<p>On Sat, June 2nd, Ft. Collins will play host to a UFO local, the 8th Annual Payton Classic at City Park. This event is always a favorite, with great teams showing up to take part. The "Payton Classic" was named in honor of Colorado''s first State Champion, Payton. This is a stop on the UFO World Cup Circuit and will be run using UFO rules.</p>\n<p>Cool prizes, Colorado Cup points, and World Cup points will be on the line and of course, a few hours in the warm sun with your favorite buddy playing frisbee. What could be better!!</p>\n<p>&nbsp;</p>\n<p>Online registration is now open, and will stay live until 9pm Thursday night.</p>\n<p>Click HERE to register online!</p>\n<p>&nbsp;</p>\n<p>On site registration will open at 8:30 and the event will start at 9:30. Bring your dog, your frisbees, your leash, some water, and maybe even a picnic lunch!&nbsp;</p>\n<p>&nbsp;</p>\n<p>This event is a classic, with incredible weather, a wonderful location and loads of history. The event is named in honor of the first Frisbee Dog State Champion of Colorado, a border collie named Payton. She was owned and trained by Todd Stevens, one of the founders of the club. Todd and Payton were one of the first superstar teams to represent the state.</p>\n<p>&nbsp;</p>\n<p>As this is a UFO event, there will be entry fees collected:</p>\n<p>&nbsp;</p>\n<p>Novice division-$5</p>\n<p>Rec division-$5 (the "just for fun!", non-competitive division)</p>\n<p>Intermediate-$7</p>\n<p>Advanced-$10</p>\n<p>Open division-$10</p>\n<p>Dual (same dog in Advanced and Open)-$20</p>\n<p>&nbsp;</p>\n<p>Weather permitting, we hope to allow everyone two rounds. We will be running two fields with the following order:</p>\n<p>&nbsp;</p>\n<p>Field 1: Open Division Freestyle, Advanced Division/Open Division T&amp;C</p>\n<p>Field 2: Intermediate Division, Novice Division, Rec Division</p>\n<p>In the event of inclement weather, the event host may elect to institute cuts for some divisions.</p>\n<p>&nbsp;</p>\n<p>All divisions will be run in an ordered fashion, but we will be flexible for those teams/people/dogs that are running in multiple events on different fields.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Open Division teams will do 1 round of Freestyle and 1 round of T&amp;C.</p>\n<p>All other divisions will do 2 rounds of T&amp;C. If we need to cut the event short due to weather, Novice, Intermediate and Advanced division teams may have a cut for the second round.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Teams that register as ''Dual'' will do one round of FS for Open Division, 1 round of T&amp;C that will count for BOTH Advanced and Open scores, and then a second round of T&amp;C for Advanced. If there is a cut in Advanced, the first round of T&amp;C Will still count for both Open and Advanced.</p>\n<p>&nbsp;</p>\n<p>Hope to see you all there!!</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:06:29', 1, '2013-01-12 11:59:31', 1, 0),
(70, 5, 0, '', 'Colorado Springs, CO - SpringSpree', '2013-06-15', NULL, 'Memorial Park Colorado Springs CO', '38.7989427, -104.77690150000001', '<p>SATURDAY, June 15th!, The legendary Springs event is back at Springs Spree!</p>\n<p>&nbsp;</p>\n<p>For the fouth year, the Colorado Springs CDD event is part of Springs Spree! Springs Spree is a long-running festival in Colorado Springs with food, vendors, music, kid activities and car shows. The organizers are expecting 35,000 visitors a day! There are 200 vendor booths and 4 music stages. There should be TONS of spectators.</p>\n<p>&nbsp;</p>\n<p>If you are traveling - a nice hotel option is: La Quinta Inn Colorado Springs Garden of the Gods, 4385 Sinton Rd. Colorado Springs, CO 80907, 719-528-5060. They have an outdoor pool and accept pets. This hotel is about 8 miles from the park, but it is centrally located on I-25.</p>\n<p>&nbsp;</p>\n<p>The event is at Memorial Park which is located on Pikes Peak Ave between Hancock and Union Blvd. There will be vehicle unloading area by the field. Participants will park in the Ice Skating Rink parking lot.</p>\n<p>&nbsp;</p>\n<p>This event Is a CDD Local evend and will be run using Skyhoundz format. </p>\n<p>Registration will be from 7:30-8:30. The competition will begin at 9am.</p>\n<p>&nbsp;</p>\n<p>There will be four Divisions at this event -- Novice, Intermediate, Advanced, and Open. The entry to the Novice Division is Free, all other entries are $10.</p>\n<p>&nbsp;</p>\n<p>For those planning to stay awhile, make sure to bring sunscreen, water, chairs, and possibly some shade! Popup tents and sunshades are welcome and recommended.</p>\n<p>&nbsp;</p>\n<p>Don''t miss this one, lots of great fun for you and your dog right at the foot of Pikes Peak!</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:10:14', 1, '2013-02-23 16:08:59', 1, 0),
(71, 1, 0, '', 'Littleton, CO - Barney Classic', '2013-07-20', NULL, 'Sheridan High School CO', '39.6438889, -105.02944439999999', '<p>Taking a break from summer heat, the Bouncing Barney Classic is once again scheduled to be an evening event. The event is in July, but by starting a bit later, we are avoiding the midday sun. Tons of fun is guaranteed.</p>\n<p>Once again, we encourage you to bring some charcoal, or your portable BBQs and something to grill and have a fun summer cook-out at the park while the competition is going on. Plan to be there early to get your prime EZ-UP spot and your grills started.</p>\n<p>&nbsp;</p>\n<p>Online Registration is now open. Click HERE.</p>\n<p>Registration will be opening at 3pm and closing promptly at 4pm. As soon as you have registered, you will be able to go to one of the fields and run your first round of T&amp;C &ndash; in other words, there will be no &ldquo;running order&rdquo; for the preliminary rounds.</p>\n<p>Once everyone has run their first round, we will make cuts (if needed) and start the final rounds.</p>\n<p>The event format will follow the Skyhoundz rules.</p>\n<p>&nbsp;</p>\n<p>If anyone has any questions, please feel free to call my cell at (720) 495-4941</p>\n<p>&nbsp;</p>\n<p>Entry Fees:</p>\n<p>Rec-FREE</p>\n<p>Novice-$5</p>\n<p>Intermediate-$5</p>\n<p>Advanced-$10</p>\n<p>Open-$10</p>\n<p>Dual-$20(Teams entering both Advanced and Open-entry fee for both divisions)</p>\n<p>For any questions just call Rick at 720-495-4941.</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:19:15', 1, '2013-01-12 12:39:24', 1, 0),
(72, 4, 0, '', 'Colorado Canine Challenge (UFO Major)', '2013-08-03', NULL, 'Cornerstone Park CO', '39.6234335, -105.00431700000001', '<p>&nbsp;</p>\n<p>Event Info</p>\n<p>On August 4th &amp; 5th, the Rocky Mountains will tremble as the Colorado Canine Challenge is launched for the 15th year. We are once again proud to host one of the UFO Major stops on Saturday, where we expect to see some amazing local and national teams in action. Then on Sunday, we welcome the Quadruped where we hope to see some distance records broken! The Quadruped series again makes its final stop in Colorado in 2012, so come out and be a part of the action!</p>\n<p>&nbsp;</p>\n<p>The 2012 Canine Challenge will take place in Littleton, Colorado. This is a suburb of Denver. The competition is going to take place at Cornerstone Park, just east of Santa Fe on Bellview. There are several large soccer fields at this park. There is plenty of parking but not a lot of shade on the fields. Please plan on a hot Colorado day, and bring some shade and cold drinks!</p>\n<p>&nbsp;</p>\n<p>Fun Stuff</p>\n<p>In the coming weeks, we will let you know about some extra activities you can take part in while you enjoy Colorado! In the past we have done hikes, brewery tours, and other very "Colorado" activities! Stay tuned!</p>\n<p>&nbsp;</p>\n<p>The Colorado Disc Dogs would ALSO like to invite all of our competitors and out-of-town guests to our famous after-event party. The CDD will provide a yummy dinner Saturday night after the competition. Dinner will be at the field at 5pm. Vegetarian options will be available.&nbsp;</p>\n<p>&nbsp;</p>', 'La Quinta Inn & Suites Denver Tech Center', '<p>Hotel Information</p>\n<p>The event Hotel is still close by, about 10 minutes away!</p>\n<p>Our official Event Hotel is the La Quinta-Denver Tech Center. The Rate is $55/night, plus tax.</p>\n<p>Now, this is NOT the same La Quinta we have used in the past! To make a reservation at the right hotel, and get the CCC rate, please call the hotel directly at 303-649-9969. Hit "6" to go to the front desk, tell them you would ...like a room in the "Colorado Canine Challenge" block to get this super deal! Here is the hotel info:</p>\n<p>&nbsp;</p>\n<p>La Quinta Inn &amp; Suites Denver Tech Center</p>\n<p>7077 South Clinton St</p>\n<p>Greenwood Village, CO 80112</p>\n<p>(303) 649-9969</p>\n<p>$55 plus tax, per night. Book under "Colorado Canine Challenge"</p>\n<p>&nbsp;</p>\n<p>This block of rooms will be held until Friday, July 13th. After that, they WILL honor the special rate, but the rooms will be simply what they have available. Call soon, book now, get this killer deal on rooms for the CCC!!!</p>\n<p>So Again, this is NOT the La Quinta at Hampden (285) &amp; Wadsworth. This La Quinta is in the other direction. It is just off of I-25. There are **2** La Quintas in the area, very close together. This is the location that is further south.</p>\n<p>Fro...m I-25, exit Arapahoe road and go east. You will see a LQ here. That is NOT it. Go 1 block east to Clinton, turn right (south), and go 2 blocks south. Our La Quinta will be on the right. If you go somewhere else, the rate is higher, and not our special rate!!</p>', '7077 South Clinton St', 'Greenwood Village', 'CO', 80112, '(303) 649-9969', '39.5883857, -104.87894299999999', NULL, '2013-01-12 11:24:36', 1, '2013-01-12 12:40:17', 1, 0),
(73, 7, 0, '', 'Littleton, CO - Quadruped', '2013-08-04', NULL, 'Cornerstone Park CO', '', '<p>Registration begins at 8:00am.</p>\n<p>&nbsp;</p>\n<p>Rules meeting will be at 8:45am.&nbsp;</p>\n<p>This is the final event of the 2012 Quadruped series! At the end of the event, in addition to the normal awards, the Quadruped National Championships in Long Distance will be awarded to the top men''s and top women''s throwers and their dogs!</p>\n<p>&nbsp;</p>\n<p>Entry fee: $35.00</p>\n<p>One entry per thrower, however, a family dog can be shared by 2 different people in 2 different divisions.</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:26:23', 1, '2013-01-12 12:40:35', 1, 0),
(74, 3, 0, '', 'Avon, CO - CDD Mountain Event', '2013-08-24', NULL, 'Harry A Nottingham Park Avon CO', '39.6360415, -106.5285824', '<p>&nbsp; The CDD once again heads to the mountains for our annual search for cooler temps during the dog days of August.</p>\n<p>&nbsp;</p>\n<p>Please note that weighted tents are preferred, but stakes no longer than 6 inches will be allowed. All items will have to be carried or carted onto the field, so plan ahead for that.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Online Registration for this event is NOW OPEN! Click here!</p>\n<p>&nbsp;</p>\n<p>Our events that day: Registration opens at 9:00 am.&nbsp;</p>\n<p>Between 9:15 and 9:30 start, Mini disc distance catch, one thrower, one dog. Three throws, the three teams with the longest catches win and split pot of entry fees of $1 based on placement. Must use mini discs, no pup discs. Mini discs will be available for purchase. Bring your dog, your disc and your dollar to the throwing line once announced. No one will be allowed to enter the line after the 8:50 am deadline.&nbsp;</p>\n<p>&nbsp;</p>\n<p>9:00 am Intermediate T&amp;C on field 2, cost $7 per entry.&nbsp;</p>\n<p>9:30 am Open Freestyle on the main field, cost $10 per entry.&nbsp;</p>\n<p>10:00 am (or when Int. finishes) Novice T&amp;C on field 2, cost $5 per entry.&nbsp;</p>\n<p>11:00 am (or when Novice finishes), Advance T&amp;C on field 2, cost $10 per entry.</p>\n<p>12:00 to 12:30 lunch break.</p>\n<p>12:30 pm (or when Open FS finishes) Intermediate FS on main field, cost $7.</p>\n<p>(There will be no cup points or prizes awarded for this division. This is just a chance for those interested in trying freestyle, or who want to work on their skills.)</p>\n<p>Teams competing in Dual FS and T&amp;C - $20 entry.</p>\n<p>We will try to accommodate those in the dual category to run their dogs in the T&amp;C running order as needed to fit the freestyle running order. Thank you for being patient if we need to move a team ahead of you.</p>\n<p>&nbsp;</p>\n<p>Depending on the amount of entrants and the days progression, (lateness, weather) cuts may be instituted per the officer''s decision.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Field set up will begin around 7:00 am if you are interested in helping with getting the games rolling. Just show up and we will put you to work. All the volunteers are greatly appreciated in helping our events run smoothly.&nbsp;</p>\n<p>&nbsp;</p>\n<p>The Colorado mountains in summer will almost always experience afternoon thundershowers, so a prepare for this possibility. But the morning will be beautiful!</p>\n<p>Hope to see you all there!:</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:29:57', 1, '2013-01-12 12:41:36', 1, 0),
(75, 3, 0, '', 'Littleton, CO - Summerset Fest', '2013-09-14', NULL, 'Clemet Park CO', '39.606533, -105.07896299999999', '<p>The final (official)event of the CDD season is a 2 day affair. The event is run in conjunction with SummersetFest, in Clement Park.</p>\n<p>Day one is a UFO Local, so precious World Cup points are on the line for the Open division. It is also the final event of the CDD State Championship series, so all divisions will play for Colorado Cup points.</p>\n<p>Please Note-on day one of the festival, we will be at the top of the hill, next to the Columbine Memorial.</p>\n<p>The standard UFO divisions will be offered:</p>\n<p>Novice division-$5</p>\n<p>Rec division-$5 (the "just for fun!", non-competitive division)</p>\n<p>Intermediate-$7</p>\n<p>Advanced-$10</p>\n<p>Open division-$10</p>\n<p>Dual (same dog in Advanced and Open)-$20</p>\n<p>We have limited space for day one of this event, so only one field is set up. So be prepared for a potentially long day in the sun. With SummerSetFest right at the bottom of the hill, all the yummy food and cool drinks you could want are within walking distance!</p>\n<p>&nbsp;</p>\n<p>This is the last tune-up in Colorado before the "Finals Season" kicks in and we always look forward to sending off the best in Colorado to bring home big titles!</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:35:09', 1, '2013-01-12 12:42:34', 1, 0),
(76, 9, 0, '', 'Littleton, CO - Summerset Fest', '2013-09-15', NULL, 'Clemet Park CO', '39.606533, -105.07896299999999', '<p>Day 2 of our final event of the year!</p>\n<p>With fall coming on soon, the last hurrah of summer lets us get out and play with the dogs in the bright Colorado sunshine one more time!</p>\n<p>SummerSetFest is the venue for our last official club event of the year. And in 2012, it will be a special one!</p>\n<p>The newly announced UFO D-Tour will make a stop in Colorado! What''s the D-Tour? It is a long-distance lovers dream! The fun UFO Longshot will take place, as in year''s past. Two new events will join it:</p>\n<p>The UFO "Team Distance" event. Get your long-throwing friends and their fast dogs together, because you have to work as a team to win this one! Men''s, Women''s and Mixed divisions will throw to try to get the highest team score (the distances of each team member added together).</p>\n<p>Finally, the UFO "Classic Distance" event is old school. One thrower, one dog, 3 throws to get the longest catch. The prize? UFO hardware, AND the top 3 teams qualify for the UFO D-Tour Championship, taking place at the UFO Finals! Men''s and Women''s divisions for this event, the PRO teams play for the qualifying spots and the REC teams play for fun.&nbsp;</p>\n<p>Full Rules of all divisions can be found HERE.</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 11:36:57', 1, '2013-01-12 11:36:57', 1, 1),
(77, 9, 0, '', 'Littleton, CO - Summerset Fest', '2013-09-15', NULL, 'Clemet Park CO', '39.606533, -105.07896299999999', '<p>Day 2 of our final event of the year!</p>\n<p>With fall coming on soon, the last hurrah of summer lets us get out and play with the dogs in the bright Colorado sunshine one more time!</p>\n<p>SummerSetFest is the venue for our last official club event of the year. And in 2012, it will be a special one!</p>\n<p>The newly announced UFO D-Tour will make a stop in Colorado! What''s the D-Tour? It is a long-distance lovers dream! The fun UFO Longshot will take place, as in year''s past. Two new events will join it:</p>\n<p>The UFO "Team Distance" event. Get your long-throwing friends and their fast dogs together, because you have to work as a team to win this one! Men''s, Women''s and Mixed divisions will throw to try to get the highest team score (the distances of each team member added together).</p>\n<p>Finally, the UFO "Classic Distance" event is old school. One thrower, one dog, 3 throws to get the longest catch. The prize? UFO hardware, AND the top 3 teams qualify for the UFO D-Tour Championship, taking place at the UFO Finals! Men''s and Women''s divisions for this event, the PRO teams play for the qualifying spots and the REC teams play for fun.&nbsp;</p>\n<p>Full Rules of all divisions can be found HERE.</p>', '', '', '', '', '', 0, '', '', NULL, '2013-01-12 13:02:39', 1, '2013-01-12 13:02:39', 1, 0),
(78, 4, 0, '', 'UFO Final Major', '2013-10-25', NULL, 'TBD', '', '<p><span class="futura_black_12pt">Final UFO Major! Taking place in Colorado for the first time ever!! This is the l</span><span class="futura_black_12pt">ast chance to get World Cup points and qualify for the World Final. For Colorado teams this event is not part of the Colorad Cup race. Any points earned count toward UFO standings only.&nbsp; </span></p>', '', '', '', '', '', 0, '', '', NULL, '2013-02-18 21:04:03', 1, '2013-02-18 21:10:20', 1, 0);
