(10, 0, 'Competitions/Events', '<p>The Colorado Disc Dogs runs a series events throughout the year. Members compete for points in the Colorado Cup Series and points for sanctioned world championships.&nbsp;</p>', 'competitions', NULL, NULL, 1, NULL, NULL, '2013-02-12 00:22:34', 1, 0),
(11, 0, 'Demo Team Profiles', '<p>Check out the demo team.</p>', 'Demo-Team', NULL, NULL, 1, '2013-02-10 14:03:06', 1, '2013-02-10 14:03:20', 1, 0),
(12, 0, 'General Rules', '<p style="text-align: justify;">The Colorado Disc Dogs run several competitions a year. These events are often sanctioned by a national or international frisbee dog governing body, and thus our events are run using the freestyle and minidistance rules of that particular organization. For events that are not nationally sanctioned, the club will usually elect to use the rules of one of the major organizations, usually the<a title="UFO" href="http://www.ufoworldcup.org/" target="_blank"> UFO</a> or <a title="skyhoundz" href="http://skyhoundz.com" target="_blank">Skyhoundz</a>. While similar, there are small differences between the two that should be understood.&nbsp;</p>\r\n<p style="text-align: justify;">Clicking the links above for the above mentioned organizations will take you to their homepage, where you can learn the rules and guidelines you should know for each. A <a href="http://www.ufoworldcup.org/" target="_blank">UFO </a>Major, a <a href="http://skyhoundz.com" target="_blank">Skyhoundz</a> Open Regional, an <a title="AWI" href="http://www.ashleywhippet" target="_blank">AWI</a> Qualifier and The <a title="quadruped" href="http://www.thequadruped.com" target="_blank">Quadruped</a> also usually make stops in Colorado each season, and these events are run by the organizers rules. Please see their official sites for more information. For newcomers, playdays are a great place to get help with the various organization''s rules, as is Spring Training!</p>\r\n<p style="text-align: justify;">In addition, The Colorado Disc Dogs have a general set of rules for our events. In order for our events to run smoothly, we ask that everyone observe these basic disc dog etiquette guidelines.</p>\r\n<p>&nbsp;</p>\r\n<p><span style="text-decoration: underline;"><strong>Basic Guidelines for Competition</strong></span></p>\r\n<ul>\r\n<li style="text-align: justify;">Keep your dog on a leash at all times when you are not competing or warming up. This saves you the embarrassment of having your dog run onto the field and interrupting the competition.</li>\r\n<li style="text-align: justify;">Not all dogs, even well socialized ones, appreciate having other dogs in their space. Please be aware of what your dog is doing at the end of your 16-foot flexi-lead.</li>\r\n<li style="text-align: justify;">Always pick up after your dog, and remind others to do the same. We try very hard to maintain good relations with the communities that allow us to host our events in their areas, and this is the main way we show our gratitude. Always leave the event site cleaner than you found it!</li>\r\n<li style="text-align: justify;">As a courtesy to competitors, no food or treats of any kind are allowed on the competition field. Food dropped on the playing field may cause unnecessary distractions.</li>\r\n<li style="text-align: justify;">Please exhibit good sportsmanship. This is a family sport, and we want our kids to be able to look up to you. Set a good example.</li>\r\n<li style="text-align: justify;"><strong>NO</strong> female dogs in heat allowed at the competition site.</li>\r\n<li style="text-align: justify;">Please treat your dog with respect. At the discretion of the contest coordinator, competitors who are seen to be mistreating their dogs will be asked to leave.</li>\r\n</ul>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><strong>Division Guidelines</strong></span></p>\r\n<p style="text-align: justify;">Most of the events run by the Colorado Disc Dogs will have four (4) divisions. The following information should help you figure out which division you and your dog should enter. And as always, the staff at the event will gladly answer any questions regarding format or which division you belong. These divisions constitute the "format" of our events. At the Skyhoundz Regional and the UFO Major, the rules for those events will take precedence, so the number and names of the divisions may change. Please see the appropriate organizer''s website to determine the format for our "big"events.</p>\r\n<p style="text-align: justify;">The four divisions that the CDD will offer at its events are: Novice, Intermediate, Advanced, and Open. On some occasions, a non-competitive Recreational division may be offered as well.</p>\r\n<p style="text-align: justify;"><strong>Novice Division:</strong> The novice division has been, and will continue to be, a division for people new to the sport. However, people progress at different rates when they start going to competitions -- some people improve quickly, and others get better more gradually -- and the club recognizes this. To that end, we allow new teams to remain in the Novice division for two years. During their first year (365-day rule), a novice team may remain in the division no matter what results they put up. However, during their second year, if a team competing in Novice earns two "Top 3" finishes, they must immediately move up to a higher division.</p>\r\n<p style="text-align: justify;">It should be noted that new teams are not required to stay in Novice. They can move up into other divisions at ANY time.</p>\r\n<p style="text-align: justify;">(Note: The Rookie of the Year prize is still only for teams competing in their first SEASON, and the cut-off is still January 1. If you''ve competed prior to Jan. 1, with any dog, in any Frisbee event, you are NOT eligible for Rookie of the Year.)</p>\r\n<p style="text-align: justify;">Novice competitors will compete in two rounds* of Mini-Distance (also called Distance/Accuracy or Throw &amp; Catch) getting 60 seconds in each round to make as many throws for their dog as possible using a single disc. Points are awarded for catches based on length of throw and whether the dog was in the air at the time of the catch. Upon registration, all novice competitors will receive an official disc. Novice competitors may then use this disc or most any other safe disc in competition, including floppies.</p>\r\n<p style="text-align: justify;"><strong>Intermediate Division:</strong> The Intermediate Division is for experienced teams who have been involved in the sport for more than a year (365 days), but are not ready for the Advanced Division yet. Intermediate competitors will compete in the same Mini-Distance format mentioned above. Intermediate competitors must use a standard competition disc (Wham-O Fastback Frisbee, Hero 235, Dogstar, or HyperFlite). Some events do provide 1 disc at sign-up, but competitors at this level and above need to provide their own discs. Official club discs will be available for sale at competitions.</p>\r\n<p style="text-align: justify;"><strong>Advanced Division:</strong> The Advanced Division is for the top MiniDistance teams. These teams are generally very experienced, but the division is open to anyone.</p>\r\n<p style="text-align: justify;"><strong>Open Division:</strong> The Open Division is for the most experienced teams and consists of round of Mini-Distance and one round of Freestyle.&nbsp;</p>\r\n<p style="padding-left: 30px; text-align: justify;">Teams entered in the open division will typically complete their MiniDistance round with the first round of Advanced Division.</p>\r\n<p style="padding-left: 30px; text-align: justify;">Freestyle consists of a choreographed routine with your dog set to music, utilizing multiple discs and any and every type of throw and trick you can think of. Teams are typically allowed 90 seconds (Skyhoundz) or 120 seconds (UFO) to perform. This is where you routinely see vaults off the back, flips, spins, jumps, rolls, weaves, and many other amazing moves. Please see the official rules for either the UFO or Skyhoundz. New freestylers are always welcome, so if you think you can put on a good show, please don''t hesitate to give it a try! Open competitors are also required to supply their own competition standard discs.</p>\r\n<p style="text-align: justify;"><strong>Dual Entry:</strong> Advanced and Open-For these 2 divisions only, it is allowed for a competitor to enter both divisions with the same dog. The 1st round of MiniDistance in the Advanced division will count as the MiniDistance score in the Open division. Only teams that are "entered" into Advanced will have an opportunity to advance to a second round of MiniDistance. PLEASE BE AWARE OF YOUR DOG''S CONDITION AND THEIR LIMITS. Summer competitions can quickly wear out both humans and dogs. Only enter both divisions, or consider sharing your dog, if you know your dog can handle it.</p>\r\n<p style="text-align: justify;"><strong>Recreational Division:</strong> The Recreational Division is designed to be a non-competitive division, appealing to those who want to "just play" or perhaps gain a little more experience before trying a competition. The division is open to anyone, regardless of the experience level of handler or dog. There will only be a single 60 second Toss and Catch (MiniDistance) round for each team. The round will be scored according to the normal scoring rules for that event''s format (UFO or SkyHoundz), but the teams will NOT be ranked, nor will there be a final standings posted, or prizes awarded. Upon request, competitors will receive a copy of their score sheet following the event, but it will not contain any final standings information. Since there are no standings, teams in the Rec Division will NOT earn Colorado Cup points.</p>\r\n<p style="text-align: justify;">* Depending on the number of teams registered in each division, the availability of enough space to run a second field, and whether there are enough qualified volunteers to run the second field, the event organizers may run a second field, or decide to limit participation in the Second Round to the top finishers of Round One. This decision will be made once registration is complete and announced prior to the beginning of Round One.</p>\r\n<p style="text-align: justify;">Good luck this season!</p>\r\n<p style="text-align: justify;">&nbsp;</p>', 'Rules', NULL, NULL, 0, '2013-02-10 14:20:30', 1, '2013-03-17 03:20:45', 1, 0),
(13, 0, 'History', '<p>Welcome to the online home of the Colorado Disc Dogs!</p>\r\n<p><span style="text-decoration: underline;"><strong>Early History of Disc Dog Sport</strong></span></p>\r\n<p style="text-align: justify;">Who threw the first frisbee to a dog? Very likely Fred Morrison, or an employee of Wham-o; as soon as plastic discs left their molds, dogs knew exactly what to do with them! Although we may never know the ''first'' frisbee dog, we know the dogs that put the sport on the map, and their owners who created the competitions that are still running today!</p>\r\n<p style="text-align: justify;">In 1974, 50,000 spectators at Dodger Stadium in Los Angeles jumped to their feet and cheered when an uninvited canine athlete named Ashley Whippet ran 35 miles an hour, leaped nine feet in the air, and caught Frisbee discs from his owner Alex Stein for eight uninterrupted minutes between innings. But neither that audience, nor the millions watching the pennant-crucial game between the Los Angeles Dodgers and Cincinnati Reds on television, could have predicted they were witnessing the birth of a canine competition that would soon thrill legions of dog lovers throughout the world. Ashley''s national stadium debut was engineered by his owner Alex Stein, then a student at Ohio State. When Hollywood talent scouts failed to return Stein''s calls, he took matters into his own hands and smuggled Ashley into Dodger Stadium on the evening of August 4, 1974. Ashley went on to break all records, winning the Canine Frisbee Disc World Championships three times.&nbsp;</p>\r\n<p style="text-align: justify;"><img style="float: left; margin: 5px;" src="http://www.coloradodiscdogs.com/images/ashley_whippet.jpg" alt="Ashley Whippet in flight" width="175" height="241" /> Later, Ashley starred in a television commercial, entertained Amy Carter and her friends at the White House, performed at halftime at Super Bowl XII, and was a guest with Stein on such television programs as: "Wide World of Sports," "Good Morning America," "The Tonight Show," and others. He entertained at practically every NFL and Major League Baseball stadium in the United States and Canada, and starred in "Floating Free" -- a film documentary nominated for an Academy Award.&nbsp;</p>\r\n<p style="text-align: justify;">Before Ashley showed up in Southern California, there was already a frisbee catching dog movement in its early stages. The main innovator behind this new application of frisbee was a man named Eldon McIntire. Eldon was a dog trainer and a frisbee afficianado, and it didn''t take long for him to see how the disc sparked the interest of his dog, Hyper Hank. Hank was an Australian Shepherd, and Eldon began refining techniques of throw &amp; catch with Hank that challenged Hank''s tracking abilities. The ''sport'' was in the early development stage when Ashley exploded on the scene. Inspired by the event, Eldon McIntire contacted a local radio show to make them aware of this growing phenomenon. The radio station responded by organizing the first ever frisbee dog competition, "The Fearless Fido Frisbee Fetching Fracas"! This Classic event represented the beginning of the competitive aspect of the sport. Eldon, the innovator, and Hank, the prototypical frisbee dog, won the competition.&nbsp;</p>\r\n<p style="text-align: right;"><img style="border: 0; float: right; margin: 5px;" src="http://www.coloradodiscdogs.com/images/HyperHank.jpg" alt="Hyper Hank" width="251" height="258" border="0" /></p>\r\n<p style="text-align: right;"><span class="table_text_blue">&nbsp; <br /></span></p>\r\n<p style="text-align: justify;">With the Frisbee craze beginning to peak, the new sport of canine frisbee was added to the line-up of events in the World Frisbee Championships at the Rose Bowl. Eldon and Hank performed all over the country, at Major League Baseball events, NFL, etc. They were featured at the last "College All-Star" game ever held, an event that was broadcast during the 1976 Olympics, and due to a fortuitous television edit, Hank and Eldon performed for an audience of nearly 1 billion people world-wide.</p>\r\n<p style="text-align: justify;">Eldon and Alex, with Hank and Ashley, travelled and performed for many years. Along with Whamo promoter and PR genius Irv Lander, they created the sport of canine disc, and managed the competitions for many years.</p>\r\n<p>&nbsp;<span style="text-decoration: underline;"><strong>History of the Colorado Disc Dogs</strong></span></p>\r\n<p style="text-align: justify;">There were certainly dogs catching frisbees in Colorado prior to the early 90''s, and there were even competitions being run in some cities. Posters from the 1984 Rocky Mountain Frisbee Championships even advertised frisbee dog demonstrations. But until 1994, there was no organized club to promote the sport and introduce new people to this great pasttime. In 1993, Californian Rick Brydum loaded up his family and came out to the Rockies. Rick found no clubs, and very few competitions.</p>\r\n<p style="text-align: justify;">Rick Brydum''s frisbee dog interest and abilities were honed in the ''80''s Southern California frisbee dog scene. Regularly competing with the likes of Lou McCammon, Gary Suzuki, Bill Watters, Gary Gomes, Reed Ferguson, and other folks, Rick was in the thick of the sport at its very epicenter. Rick and his two Aussies, Sean and Sasha, were excellent competitors -- multitime regional finalists. Rick''s frisbee dogs appeared in a Japanese shoe commercial, and Rick and Sean eventually won the Pacific Coast Championship. These two amazing Aussies were also one of the first "double dog" teams around! Rick brought all this experience and enthusiasm to Colorado in 1993, and in 1994, started the state''s first frisbee dog club, the Front Range Flyers K9 Disc Club.</p>\r\n<p style="text-align: justify;">&nbsp;<img style="float: left; margin: 5px;" src="http://www.coloradodiscdogs.com/images/RickCycleDays.jpg" alt="Rick Brydum back int the day" width="279" height="189" /></p>\r\n<p style="text-align: justify;">Around the same time, another Californian refugee and his family moved to Colorado. Glen Medford brought a mess of freestyle tricks and a lot of willingness to help out and teach the younger generations starting off in Colorado. Glen''s dog Brittany had traveled the world catching frisbees, and even appeared in a Sunkist ad. Glen was very influential to the first "native" Colorado Frisbee dog freestylers.&nbsp;</p>\r\n<p style="text-align: justify;">Rick shortly adopted another great Aussie, Barney, and with a new club and an itch to make something happen in the state, Rick contacted Irv Lander, the executive director of the Ashley Whippet Invitational, and co-founder of the sport. Rick told Irv there was not much here, but lots of potential. Irv was excited to have a local contact in Colorado, as they had wanted to put an event in the Denver area for some time. Rick and Irv worked together, and the result was one of the most famous and formidable contests to ever run -- The Open Regional.&nbsp;</p>\r\n<p style="text-align: justify;">At the time, the disc dog world consisted of the Ashley Whippet World Championships, owned and operated by Ashley Whippet Enterprises (AWE). AWE events consisted of several regional contests. The top two competitors from each would earn a trip to the World Championships. The Open Regional was conceived as a "last chance" regional to earn two of those World Championship berths. The first Open took place in 1994, at Dove Valley Park, across from the Denver Broncos training center. Nearly 100 teams showed up -- the cream of the frisbee dog crop! The event continued through 1997. In 1998, it was split into 2 regionals, an east and a west, held on their respective coasts. The success of the Open regional spawned the Colorado Canine Challenge, which was first held in 1998. The CCC continues the tradition of top flight frisbee dogs gathering to establish the top dog!</p>\r\n<p style="text-align: justify;">As Rick was helping to establish some new competitions in the state, his work had enough of an influence to cause a second Colorado club to come into existence. In early 1996, in the frisbee-saturated Ft. Collins area, Chris Sexton, Liz Brennfleck and Todd Stevens started the Northern Colorado Disc Dogs. This club was a smaller, regional club, hosting the Ft. Collins competition and regular playdays. The two clubs always attended and assisted each other''s events, with Rick providing guidance and experience to the excited upstarts.&nbsp;</p>\r\n<p style="text-align: center;"><img style="display: block; float: right; margin: 5px;" src="http://www.coloradodiscdogs.com/images/Chris_Laika2.gif" alt="Chris Sexton and Laika" width="172" height="216" /></p>\r\n<p style="text-align: justify;">To the south of Denver, another of Rick''s proteges, Rob Provost, was building a contest of his own. The Colorado Springs scene grew largely out of Rob''s efforts in that city, both in demos and at his heavily attended contest. Rob''s dog Hershey would prove to be one of the most consistent and excellent MiniDistance frisbee dogs around, and was the inspiration for the Club''s annual "Hershey Memorial Award," given to the team with the highest MiniDistance score of the year.&nbsp;</p>\r\n<p style="text-align: justify;">Rick, Rob, Chris and Todd worked together to run great contests, and very soon, club resources were combined. The two clubs ran as one entity, and in early 1999, the last vestiges of 2 separate clubs were retired. The new club name was unveiled -- The Colorado Disc Dogs. A killer logo and more contests and shows than ever made Colorado a frisbee dog hotspot, and it continues to be today.&nbsp;</p>\r\n<p style="text-align: justify;">Today, Rick and Chris still are still actively involved with club, along with a ton of support from many club members. The Colorado State Championship Series, which awards the Colorado Cup to the State Champ each year, was started in 1997. The series continues today, with a Rookie of the year recognized each year as well. Playing host to prestigious events like the FDDO, The Quadruped, and World Cup events, Colorado will be in the fast lane for frisbee dog action for a long time to come!&nbsp;</p>', 'History', NULL, NULL, 0, '2013-02-10 14:23:51', 1, '2013-03-17 03:19:33', 1, 0),
(14, 0, 'Sponsorship', '<h2><span style="text-decoration: underline;"><strong>Individual Sponsorship and the CDD</strong></span></h2>\n<p style="text-align: justify;">Sponsorship has long been a part of the sport of canine frisbee. The earliest events had support from Wham-o, and shortly thereafter, Kal-Kan, thus beginning a long line of dog food sponsors.</p>\n<p style="text-align: justify;">Since the departure of the last "big" sponsor of the sport, Alpo, at the end of the 2000 season, we have seen various events and organizations "open up" their fields to individual sponsorship. Similarly, we have seen many teams get sponsored in many different capacities. Where it is allowed, this can be a great benefit to both the sponsor and the individual team.The CDD would like to make sure that the environment that we offer people to play in is sponsor-friendly. Both for our event sponsors and for any individual sponsors that may teams may bring in.</p>\n<p style="text-align: justify;">To that end, here is a list of what the CDD guidelines for sponsorship are. If there are any problems with this list, you can address them (politely!) on the club list, or you can email the officers privately, and they will try to answer your question. If you come up with something that this list does not address, feel free to make it known to the officers, and we will see if we need to address it, or if it is beyond the scope of this project.</p>\n<p style="text-align: justify;">With all the below provisions, it SHOULD go without saying that ANY clothing or banners, sponsored or not, be in good taste for public, family friendly events!</p>\n<p style="text-align: justify;"><strong>At club-run competitions:</strong></p>\n<p style="text-align: justify;"><strong>Clothing</strong>-The CDD allows competitors to wear any and all sponsor logo-ed hats, shirts, shorts, socks, shoes that they like. Any vests or coats on the dogs may also display a sponsor logo. There are no restrictions here, although competitors may read the rules regarding "Costumes" at website for the national organizers.</p>\n<p style="text-align: justify;">Historically, some event organizers have asked that all competitors wear an event t-shirt. If an event with this requirement is taking place under the direct administration of the CDD, it will be up to the national organizer, not the club, to make this known and enforce it.</p>\n<p style="text-align: justify;"><strong>Tents</strong>-branded tents (not banners) are allowed at club-run events. However, in some cases, the club may ask that the tent not be placed immediately next to the field. This would only be in the event that a conflicting sponsor is sponsoring the event. If there are any questions, check with a club officer.</p>\n<p style="text-align: justify;"><strong>Banners</strong>-Competitors can hang any sponsor banners they like at the back of their tent. If a team wants to put a banner on the front of their tent, they will need to check with the club. The only situation where we might ask that a banner be moved to the rear of a competitor''s tent is if a conflicting sponsor is sponsoring the event. If there are any questions, check with a club officer.</p>\n<p style="text-align: justify;"><strong>Sponsor announcements</strong>-This warrants special mention. If a sponsored competitors would like the club to announce their sponsors as they come on to the field for their round, the announcer MIGHT be able to do this. This is ABSOLUTELY NOT GUARANTEED. With the hectic pace of a CDD event, the large number of competitors, and many people doing more than one job, we can tell you that we will try to make the announcement as you take the field. This will be entirely up to the discretion of the Announcer. The competitor MUST supply this information to the announcer, and please keep it VERY brief. Though we have a little bit of time between competitors, we want to avoid unnecessary delays. Also keep in mind that we often have other important things to announce, and event sponsors are guaranteed PA placements, so the time between competitors may be already taken. But we will give it our best shot!</p>\n<p style="text-align: justify;"><strong>Individual sponsorship at club demos</strong>-</p>\n<p style="text-align: justify;">At demos that the club performs at, we will need to maintain a professional appearance, and we will ask anyone performing to please wear the provided demo team shirt. Teams participating in demos need to remember that the demo is NOT a place to promote your own individual sponsors, and in some circumstances the club may actually be getting paid and an individual sponsor may be inappropriate. If there are any questions, check with our Demo coordinator. We do want to say that we believe that performing with the CDD demo team is a great experience, and if you need to cite your experience with the team for the purposes of obtaining sponsorship, please do so!</p>\n<p style="text-align: justify;">We hope this serves as a good guide for our sponsored teams.</p>', 'Sponsorship', NULL, NULL, 0, '2013-02-11 23:43:34', 1, '2013-02-24 14:27:15', 1, 0),
(15, 0, 'Top Honors', '<p style="text-align: center;"><span style="text-decoration: underline;"><strong>CDD State Champions:</strong></span><br /> 1997-Todd Stevens &amp; Payton<br /> 1998-Christi Goodman &amp; Rider<br /> 1999-Christi Goodman &amp; Rider<br /> 2000-Christi Goodman &amp; Rider<br /> 2001-Christi Goodman &amp; Rider<br /> 2002-Christi Goodman &amp; Rider<br /> 2003-Christi Goodman &amp; Rider<br /> 2004-Marie Earle &amp; Bo<br /> 2005-Mark Brisse &amp; Gabby<br /> 2006-Matt DiAno &amp; Maggie<br /> 2007-Matt DiAno &amp; Maggie<br /> 2008-Matt DiAno &amp; Maggie<br /> 2009-Jason Holland &amp; Dash<br /> 2010-Mike Hanson &amp; Maggey<br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey</p>\n<p style="text-align: center;"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<table style="width: 9.75in; margin-left: -48.6pt; border-collapse: collapse; mso-padding-alt: 0in 5.4pt 0in 5.4pt;" width="936" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td style="width: 3.25in; padding: 0in 5.4pt 0in 5.4pt;" valign="top" width="312">\n<p class="MsoNormal"><strong>CDD Rookie of the Year</strong> <strong>Team:</strong></p>\n<p class="MsoNormal">1997-Scott Schroff &amp; Rowdy<br /> 1998-Scott Shick &amp; Cindy Loo<br /> 1999-Matt Buhr-Vogl &amp; Shunka<br /> 2000-Shane Hartson &amp; Outback<br /> 2001-Fred Parks &amp; Kona<br /> 2002-Charles White &amp; Molly<br /> 2003-Jeff Carpenter &amp; Hero<br /> 2004-Matt DiAno &amp; Maggie<br /> 2005-Kerry Samet &amp; Maggie<br /> 2006-Doug Dornseif &amp; Ollie<br /> 2007-MIke Cooper &amp; Kiva<br /> 2008-Amy Cadena &amp; Kipp<br /> 2009-Brian White &amp; Marley<br /> 2010-Heather White &amp; Marley<br /> 2011-Tammy Salzman &amp; Banjo<br /> 2012-Dan McCarthy &amp; Sage</p>\n</td>\n<td style="width: 3.25in; padding: 0in 5.4pt 0in 5.4pt;" valign="top" width="312">\n<p class="MsoNormal"><strong>Hershey Memorial Award:</strong><br /> Awarded Annually to the best T&amp;C disc dog team in the state.</p>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal">2001-Fred Parks &amp; Kona<br /> 2002-Russ Friesen &amp; Charlie<br /> 2003-Dave Hale &amp; Scooby<br /> 2004-Jeff Mueller &amp; Fly<br /> 2005-Gayle O''Malley &amp; Sheela<br /> 2006-Jeff Mueller &amp; Fly<br /> 2007-Matt DiAno &amp; Maggie<br /> 2008-Matt DiAno &amp; Maggie<br /> 2009-Matt DiAno &amp; Maggie<br /> 2010-Mike Hanson &amp; Maggey<br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey<br /> </p>\n</td>\n<td style="width: 3.25in; padding: 0in 5.4pt 0in 5.4pt;" valign="top" width="312">\n<p class="MsoNormal"><strong>Red Rocket Rider Freestyle award:</strong><br /> Awarded annually to the best freestyle disc dog team in the state.</p>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal">2006-Tracy Williams &amp; Angus<br /> 2007-Mark Brisse &amp; Gabby<br /> 2008-Chris Sexton &amp; Banzai<br /> 2009-Jason Holland &amp; Dash<br /> 2010-Chris Sexton &amp; Banzai<br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p style="text-align: center;">&nbsp;</p>\n<table width="727" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td class="padding_left_right" style="text-align: left;" align="left" valign="top">&nbsp;</td>\n</tr>\n<tr>\n<td class="padding_left_right" align="left" valign="top" width="264">&nbsp;</td>\n<td class="padding_left_right" align="left" valign="top">&nbsp;</td>\n<td class="padding_left_right" align="left" valign="top">&nbsp;</td>\n</tr>\n<tr>\n<td class="padding_left_right" align="left" valign="top" width="264">&nbsp;</td>\n<td class="padding_left_right" align="left" valign="top">&nbsp;</td>\n<td class="padding_left_right" align="left" valign="top">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p style="text-align: justify;">&nbsp;</p>', 'Top-Honors', NULL, NULL, 0, '2013-02-17 18:02:12', 1, '2013-02-17 18:29:41', 1, 1),
(16, 0, 'Top Honors', '<p style="text-align: justify;">Each year the Colorado Disc Dogs recognize a State Champion and Rookie of the Year team based on a Points Series. Points are accumulated from placings at Colorado Disc Dogs events. Most events run by the Colorado Disc Dogs are opportunities for teams to accumulate points towards these titles. Teams must be registered members to receive points. The team with the highest point total at the end of the club season will be declared the "Colorado State Champions". Any team can win the State Championship title. Colorado disc dogs also recognizes the best Toss and Fetch/ Mini-Distance team and the best Freestlye team. Please see the Points Guide for how theses awards are determined. Below are listed the top honors from each season. Theses teams are not only the best in the State but many also hold national and world titles. We are proud to have them as part of our clubs history.</p>\r\n<h4 style="text-align: left;"><span style="text-decoration: underline;"><strong>CDD State Champions</strong></span></h4>\r\n<p style="text-align: left;">1997-Todd Stevens &amp; Payton&nbsp; <br /> 1998-Christi Goodman &amp; Rider<br /> 1999-Christi Goodman &amp; Rider<br /> 2000-Christi Goodman &amp; Rider<br /> 2001-Christi Goodman &amp; Rider<br /> 2002-Christi Goodman &amp; Rider<br /> 2003-Christi Goodman &amp; Rider<br /> 2004-Marie Earle &amp; Bo<br /> 2005-Mark Brisse &amp; Gabby<br /> 2006-Matt DiAno &amp; Maggie<br /> 2007-Matt DiAno &amp; Maggie<br /> 2008-Matt DiAno &amp; Maggie<br /> 2009-Jason Holland &amp; Dash<br /> 2010-Mike Hanson &amp; Maggey <img style="border: 0; float: right; margin: 5px;" src="http://www.coloradodiscdogs.com/images/homepage/MikeMaggey.jpg" alt="Mike and MaggEY" width="285" height="215" border="0" /><br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey</p>\r\n<p style="text-align: left;"><span style="text-decoration: underline;"><strong>CDD Rookie of the Year</strong> <strong>Team:</strong></span></p>\r\n<p class="MsoNormal">Awarded to the best new team in the state</p>\r\n<p class="MsoNormal">1997-Scott Schroff &amp; Rowdy<br /> 1998-Scott Shick &amp; Cindy Loo<br /> 1999-Matt Buhr-Vogl &amp; Shunka<br /> 2000-Shane Hartson &amp; Outback<br /> 2001-Fred Parks &amp; Kona<br /> 2002-Charles White &amp; Molly<br /> 2003-Jeff Carpenter &amp; Hero<br /> 2004-Matt DiAno &amp; Maggie<br /> 2005-Kerry Samet &amp; Maggie<br /> 2006-Doug Dornseif &amp; Ollie<br /> 2007-MIke Cooper &amp; Kiva<br /> 2008-Amy Cadena &amp; Kipp<br /> 2009-Brian White &amp; Marley<br /> 2010-Heather White &amp; Marley<br /> 2011-Tammy Salzman &amp; Banjo<br /> 2012-Dan McCarthy &amp; Sage</p>\r\n<h4 class="MsoNormal"><span style="text-decoration: underline;"><strong>Hershey Memorial Award:</strong></span></h4>\r\n<p class="MsoNormal">Awarded Annually to the best T&amp;C disc dog team in the state.</p>\r\n<p class="MsoNormal">2001-Fred Parks &amp; Kona<br /> 2002-Russ Friesen &amp; Charlie<br /> 2003-Dave Hale &amp; Scooby<br /> 2004-Jeff Mueller &amp; Fly<br /> 2005-Gayle O''Malley &amp; Sheela<br /> 2006-Jeff Mueller &amp; Fly<br /> 2007-Matt DiAno &amp; Maggie<br /> 2008-Matt DiAno &amp; Maggie<br /> 2009-Matt DiAno &amp; Maggie<br /> 2010-Mike Hanson &amp; Maggey<br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey</p>\r\n<h4 class="MsoNormal"><span style="text-decoration: underline;"><strong>Red Rocket Rider Freestyle award:</strong></span></h4>\r\n<p class="MsoNormal">Awarded annually to the best freestyle disc dog team in the state.</p>\r\n<p class="MsoNormal">2006-Tracy Williams &amp; Angus<br /> 2007-Mark Brisse &amp; Gabby<br /> 2008-Chris Sexton &amp; Banzai<br /> 2009-Jason Holland &amp; Dash<br /> 2010-Chris Sexton &amp; Banzai<br /> 2011-Mike Hanson &amp; Maggey<br /> 2012-Mike Hanson &amp; Maggey</p>\r\n<p style="text-align: center;"><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:DoNotOptimizeForBrowser/>\r\n </w:WordDocument>\r\n</xml><![endif]--></p>', 'Top-Honors', NULL, NULL, 0, '2013-02-17 18:41:20', 1, '2013-03-17 03:16:36', 1, 0),
(17, 0, 'Points Guide', '<table class="td_yellow_all_border_big" width="875" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td class="padding_left_right" colspan="6" align="center">\n<h2><span class="table_text_blue_big">Colorado Cup Points Series Guide<br /> <em><span>"The State Championship Series"</span></em></span></h2>\n</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">The Colorado Disc Dogs recognize a State Champion and Rookie of the Year team based on a Points Series. Points are accumulated from placings at Colorado Disc Dogs events. All events run by the Colorado Disc Dogs are opportunities for teams to accumulate points towards these titles. Teams must be from Colorado to receive points. The team with the highest point total at the end of the club season will be declared the "Colorado State Champions". Any team can win the State Championship title. <br /> The total points added up will include the top 6 point-awards from the season. For teams that travel to all 7 events, their single lowest point-awards for the season will be dropped. For teams that participate in 6 or fewer events, all of their point-awards for the season will be counted, and none will be dropped.</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="center" height="25">\n<p><strong><span class="table_text_red_2">&nbsp;</span></strong></p>\n<p><strong><span class="table_text_red_2">Open Division/Freestyle Point Scale</span></strong></p>\n</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">Any event with two complete rounds of competition that includes Freestyle. Not to include Novice, Intermediate, or Advanced category competitions (see respective point scales below). May also include special events with only one division.</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">\n<p style="text-align: center;"><span class="table_text_red_2">&nbsp;</span></p>\n<p style="text-align: center;"><span class="table_text_red_2">&nbsp;</span><strong><span class="table_text_red_2">Advanced / MiniDistance Point Scale</span></strong></p>\n</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">Advanced category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">\n<p style="text-align: center;"><span class="table_text_red_2">&nbsp;</span></p>\n<p style="text-align: center;"><strong><span class="table_text_red_2">Intermediate / MiniDistance Point Scale</span></strong></p>\n</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">Intermediate category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">\n<p style="text-align: center;"><span class="table_text_red_2">&nbsp;</span></p>\n<p style="text-align: center;"><strong><span class="table_text_red_2">Novice / MiniDistance Point Scale</span></strong></p>\n</td>\n</tr>\n<tr>\n<td class="padding_left_right" colspan="6" align="left">\n<p>Novice category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</p>\n<p><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]-->\n<p style="text-align: center;">INSERT TABLE HERE</p>\n<p style="text-align: center;"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]-->\n<p>&nbsp;</p>\n<p>Ties (at events) will be dealt with as follows. People tied will have their Colorado Cup Points added together, and divided by the number of people tied. Example: There is a tie for 4th place among 2 people. The points for fourth and fifth are added (8 + 7 = 15) and then divided by 2, to get 7.5 points for each person. <br /> <br /> Ties in the Colorado Cup points standings are not broken. <br /> <br /> Out of state competitors are not eligible for points. Their placement at individual events will be skipped for the purpose of doling out points.</p>\n<table class="td_yellow_all_border_big" width="870" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td align="center" height="25">\n<h4><span class="table_text_blue_big">Special Colorado Disc Dogs Awards</span></h4>\n</td>\n</tr>\n<tr>\n<td align="center" height="25"><strong><span class="table_text_red_2">Rookie of the Year Award</span></strong></td>\n</tr>\n<tr>\n<td align="left" height="25">This award is recognition of the best new handler and dog team in the state each year. The Qualification for Rookie status is that the handler must not have competed prior to January 1st of the calendar year for that season. The handler may use a dog that has competed before, however, the recognition is awarded to the pair as a team.<br />The Rookie of the Year (RotY) award is based on the regular CDD points series. The points that Rookie teams earn in the Colorado State Championship series (The ''Colorado Cup'') are tracked for Rookie teams. At the end of the season, the team with the most points is declared "Rookie of the Year."<br /> Ties for the RotY are not broken. In the event of a tie for first place in the series, both teams will be declared co-champions.</td>\n</tr>\n<tr>\n<td align="left" height="25">&nbsp;</td>\n</tr>\n<tr>\n<td align="center" height="25"><strong><span class="table_text_red_2">Hershey Memorial Award</span></strong></td>\n</tr>\n<tr>\n<td class="padding_left_right" align="left">This award is recognition of excellence at the short distance events, often called "MiniDistance." This award is given to the team with the highest total of their single best round in Skyhoundz Distance/Accuracy and their single best round in UFO Throw and Catch. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</td>\n</tr>\n<tr>\n<td class="padding_left_right" align="center"><strong><span class="table_text_red_2">Red Rocket Rider Freestyle Award</span></strong></td>\n</tr>\n<tr>\n<td class="padding_left_right" align="left">This award is recognition of excellence at Freestyle events. This award is given to the team with the highest total of their single best round in Skyhoundz Freestyle and their single best round in UFO Freestyle. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</td>\n</tr>\n</tbody>\n</table>\n<p><span class="table_text_blue_arial"><em>Remember-Membership in the Colorado Disc Dogs is required to earn points for CDD standings. In 2012, points will only be earned when membership is paid in full. Points will NOT be retroactively applied to a team''s standing <br /> Rookie teams-that is, people competing for the first time in 2012-are all given "Provisional Membership". This is free membership in the Colorado Disc Dogs for the first season only. These teams will earn points in the Colorado State Championship Series. The highest finishing team of this group will be declared the Rookie of the Year.</em></span></p>\n</td>\n</tr>\n</tbody>\n</table>', 'Points-Guide', NULL, NULL, 0, '2013-02-18 16:35:45', 1, '2013-02-18 18:00:14', 1, 1);
INSERT INTO `page` (`id`, `isHome`, `name`, `description`, `slug`, `start_date`, `end_date`, `automated`, `created`, `created_by`, `modified`, `modified_by`, `deleted`) VALUES
