INSERT INTO `page` (`id`, `isHome`, `name`, `description`, `slug`, `start_date`, `end_date`, `automated`, `created`, `created_by`, `modified`, `modified_by`, `deleted`) VALUES
(19, 0, 'Points Guide', '<p><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<h2 style="text-align: center;">&nbsp; <span class="tabletextbluebig">Colorado Cup Points Series Guide</span></h2>\n<h2 class="MsoNormal" style="text-align: center;" align="center"><em>"The State Championship Series"</em></h2>\n<p class="MsoNormal" style="text-align: justify;">The Colorado Disc Dogs recognize a State Champion and Rookie of the Year team based on a Points Series. Points are accumulated from placings at Colorado Disc Dogs events. All events run by the Colorado Disc Dogs are opportunities for teams to accumulate points towards these titles. Teams must be from Colorado to receive points. The team with the highest point total at the end of the club season will be declared the "Colorado State Champions". Any team can win the State Championship title. <br /> The total points added up will include the top 6 point-awards from the season. For teams that travel to all 7 events, their single lowest point-awards for the season will be dropped. For teams that participate in 6 or fewer events, all of their point-awards for the season will be counted, and none will be dropped.</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>&nbsp;</strong></span></p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Open Division/Freestyle Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Any event with two complete rounds of competition that includes Freestyle. Not to include Novice, Intermediate, or Advanced category competitions (see respective point scales below). May also include special events with only one division.</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>&nbsp;</strong></span></p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Advanced / MiniDistance Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Advanced category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</p>\n<p>&nbsp;</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Intermediate / MiniDistance Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Novice category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</p>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<div align="center">INSERT TABLE HERE</div>\n<div align="center"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></div>\n<div align="center">1</div>\n<div align="center">2</div>\n<div align="center">3</div>\n<div align="center">4</div>\n<div align="center">5</div>\n<div align="center">6</div>\n<div align="center">7</div>\n<div align="center">8</div>\n<div align="center">9</div>\n<div align="center">10</div>\n<div align="center">11</div>\n<div align="center">12</div>\n<div align="center">13</div>\n<div align="center">14</div>\n<div align="center">15</div>\n<div align="center">16</div>\n<div align="center">17</div>\n<div align="center">18</div>\n<div align="center">19</div>\n<div align="center">20</div>\n<div align="center">21</div>\n<div align="center">22</div>\n<div align="center">23</div>\n<div align="center">24</div>\n<div align="center">25</div>\n<div align="center">26</div>\n<div align="center">27</div>\n<div align="center">28</div>\n<div align="center">29</div>\n<div align="center">30</div>\n<div align="center">31</div>\n<div align="center">32</div>\n<div align="center">33</div>\n<div align="center">34</div>\n<div align="center">35</div>\n<div align="center">36</div>\n<div align="center">37</div>\n<div align="center">38</div>\n<div align="center">39</div>\n<div align="center">40</div>\n<div align="center">41</div>\n<div align="center">42</div>\n<div align="center">43</div>\n<div align="center">44</div>\n<div align="center">45</div>\n<div align="center">46</div>\n<div align="center">47</div>\n<div align="center">48</div>\n<div align="center">49</div>\n<div align="center">50</div>\n<div align="center">51</div>\n<div align="center">52</div>\n<div align="center">53</div>\n<div align="center">54</div>\n<div align="center">55</div>\n<div align="center">56</div>\n<div align="center">57</div>\n<div align="center">58</div>\n<div align="center">59</div>\n<div align="center">60</div>\n<div align="center">61</div>\n<div align="center">62</div>\n<div align="center">63</div>\n<div align="center">64</div>\n<p>&nbsp;</p>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<p style="text-align: justify;">Ties (at events) will be dealt with as follows. People tied will have their Colorado Cup Points added together, and divided by the number of people tied. Example: There is a tie for 4th place among 2 people. The points for fourth and fifth are added (8 + 7 = 15) and then divided by 2, to get 7.5 points for each person. <br /> <br /> Ties in the Colorado Cup points standings are not broken. <br /> <br /> Out of state competitors are not eligible for points. Their placement at individual events will be skipped for the purpose of doling out points.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h3 style="text-align: center;" align="center"><span class="tabletextbluebig"><strong>Special Colorado Disc Dogs Awards</strong></span></h3>\n<p>&nbsp;</p>\n<p><span class="tabletextred2"><strong>Rookie of the Year Award</strong></span></p>\n<p style="text-align: justify;">This award is recognition of the best new handler and dog team in the state each year. The Qualification for Rookie status is that the handler must not have competed prior to January 1st of the calendar year for that season. The handler may use a dog that has competed before, however, the recognition is awarded to the pair as a team.<br /> The Rookie of the Year (RotY) award is based on the regular CDD points series. The points that Rookie teams earn in the Colorado State Championship series (The ''Colorado Cup'') are tracked for Rookie teams. At the end of the season, the team with the most points is declared "Rookie of the Year."<br /> Ties for the RotY are not broken. In the event of a tie for first place in the series, both teams will be declared co-champions.</p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><span class="tabletextred2"><strong>Hershey Memorial Award</strong></span></p>\n<p style="text-align: justify;">This award is recognition of excellence at the short distance events, often called "MiniDistance." This award is given to the team with the highest total of their single best round in Skyhoundz Distance/Accuracy and their single best round in UFO Throw and Catch. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</p>\n<p>&nbsp;</p>\n<p><span class="tabletextred2"><strong>Red Rocket Rider Freestyle Award</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">This award is recognition of excellence at Freestyle events. This award is given to the team with the highest total of their single best round in Skyhoundz Freestyle and their single best round in UFO Freestyle. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><em><span style="font-size: 12.0pt; font-family: ''Times New Roman''; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">Remember-Membership in the Colorado Disc Dogs is required to earn points for CDD standings. Points will only be earned when membership is paid in full. Points will NOT be retroactively applied to a team''s standing </span></em><em><span style="font-size: 12.0pt; font-family: ''Times New Roman''; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><br /> <em>Rookie teams-that is, people competing for the first time, are all given "Provisional Membership". This is free membership in the Colorado Disc Dogs for the first season only. These teams will earn points in the Colorado State Championship Series. The highest finishing team of this group will be declared the Rookie of the Year.</em></span></em></p>\n<p>&nbsp;</p>', 'Points-Guide', NULL, NULL, 0, '2013-02-18 20:52:54', 1, '2013-02-25 14:49:40', 13, 0),
(20, 0, 'results', '<p>results</p>', 'results', NULL, NULL, 1, '2013-03-23 17:14:42', 1, '2013-03-23 17:14:42', 1, 0);
